<!DOCTYPE html>
<html lang=en>

<head>
    <meta charset=UTF-8>
    <title>Snakee.IO | GAMEE</title>
    <meta name=viewport content="width=240,initial-scale=1,user-scalable=no">
    <meta content=True name=HandheldFriendly>
    <link href=assets/css/style.css rel=stylesheet>
    <link href=assets/ui/ui.css rel=stylesheet>
    <link href=assets/ui/obstacles.css rel=stylesheet>
    <link href=assets/ui/snakes.css rel=stylesheet>
    <link rel=stylesheet type=text/css href=assets/css/slick/slick.css> <link rel=stylesheet type=text/css
        href=assets/css/slick/slick-theme.css> </head> <body>
    <div id=datGui></div>
    <div id=content style=display:block;width:100%;text-align:center></div>
    <div class=ui style=display:none>
        <div class=tap-to-play style=display:none>Tap to play</div>
        <div class=returnToGameArea style=display:none>Go back <span id=returnToGameAreaCountdown></span></div>
        <div id=score-board style=display:none></div>
        <div class=ui-background-overlay style=display:none></div>
        <div id=rewarded-video-container style=display:none>
            <div class=rewarded_video_light></div>
            <div class="rewarded_video_bg sprite">
                <div class=inner-container>
                    <div class="keep_playing sprite"></div>
                    <div class="play_rewarded_video_button sprite" id=playRewardedVideo></div>
                    <div class="skip_rewarded_video_button sprite" id=skipRewardedVideo></div>
                </div>
            </div>
        </div>
        <div class=speed-progress-wrapper>
            <div class=speed-progress>
                <div class=speed-progress-body id=speed-progress-bar></div>
            </div>
            <div class=arrow id=speed-arrow></div>
        </div>
    </div>
    <div id=lobby-screen-wrapper class=active>
        <div class=center>
            <div class="tree obstacle top-left-tree pulsing-tree"></div>
            <div class="tree obstacle top-right-tree pulsing-tree"></div>
            <div class="tree obstacle bottom-left-tree pulsing-tree"></div>
            <div class="rock obstacle bottom-right-rock"></div>
            <div class="sprite logo"></div>
            <div class=best-score-wrapper>
                <div class=header>Best score</div>
                <div class="stripe gradient_stripe sprite">
                    <div class="bug left bug_small_w sprite"></div>
                    <div class=score id=high-score>0</div>
                    <div class="bug bug_small_w sprite"></div>
                </div>
            </div>
            <div class=character-selection-wrapper></div>
            <div class="btn_play_n sprite inactive" id=play></div>
            <div id=play_rewarded_video style=display:none></div>
            <div id=purchase_character style=display:none></div>
            <div class=achievement-wrapper>
                <div class=label id=achievement-label>To unlock you need to lorem ipsum dolor sit amet</div>
            </div>
        </div>
    </div>
    <div id=achievementContainer style=display:none>
        <div class=character>
            <div class="snakes robot-head" id=achievement-character></div>
        </div>
        <div class=center-text>
            <div class=first-row>Achievement</div>
            <div id=achievementTitle>Kill the king !</div>
            <div class=third-row>New character unlocked</div>
        </div>
        <div class=cross-wrapper id=closeAchievement>
            <div class=cross></div>
        </div>
    </div>
    <div class=version id=version></div>
    <script type=text/javascript src=./js/bundle.js?1e9219a8c6b23d5140c7> </script> </body> </html>
